import re
from typing import List

from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

def _is_ip(s: str) -> bool:
    if not s: return False
    s = s.strip()
    if ':' in s or s.startswith('['): return True
    m = re.match(r'^\d{1,3}(\.\d{1,3}){3}$', s)
    if not m: return False
    parts = s.split('.')
    return all(0 <= int(p) <= 255 for p in parts)

def _space_escape(s: str) -> str:
    return (s or "").replace(" ", "%20")

@register("enumacls")
class EnumAclsBof(Bof):
    # drop in your own .o/.obj base64 the same way you do for other modules
    base64bof: str = ""

    @staticmethod
    def help_menu():
        menu = """
enumacls - Active Directory Attack Path Hunter
Read-Only • Low-Noise LDAP • Operator Use

USAGE
  bofexec enumacls -d <domain> [--dc HOST] [--ldaps] [--port N]
                   (--user <UPN|DN|sAM|SID> | --group <DN|sAM|SID> | --computer <DN|sAM|SID|hostname$> | --ou <DN>)
                   [--format csv|kv|table|json]

TARGETING
  -d, --domain <dns>     Domain DNS (e.g. bank.local). Seeds base DN & queries.
  --dc <host>        DC hostname/FQDN (no IP). Omit to use DC locator.
  --ldaps            Use LDAPS (636). Default is LDAP (389).
  --port <int>       Override port. 0/omit = scheme default.

SELECT ONE
  --user <UPN|DN|sAM|SID>
  --group <DN|sAM|SID>
  --computer <DN|sAM|SID|hostname$>
  --ou <DN>          Enumerate OU delegations → trustees → outbound rights.

OUTPUT
  --format csv|kv|table|json   (default: kv)

WHAT IT DOES
  • Pulls DACLs via SD-Flags control (nTSecurityDescriptor DACL only).
  • Builds a membership closure (ranked graph + via_path) using memberOf BFS.
  • Flags impactful rights only:
      - generic-all | generic-write
      - write-dacl | write-owner
      - delete | delete-tree
      - create/delete-child (class-scoped)
      - extended rights (e.g., reset-password, replicate-changes*)
      - attribute writes: member, servicePrincipalName, msDS-AllowedToActOnBehalfOfOtherIdentity, userAccountControl
  • Emits: subject, subject_sid (if available), target_dn, rank, via_path, right, right_kind,
           scope_hint, confidence, notes, timestamp.

NOTES
  • Read-only. No writes, no deletes. LDAP only + server controls.
  • “rank” = distance from subject (0=self, 1=direct group, …). “via_path” = chain used.
  • Use DN accuracy. If you get NO_OBJECT, resolve the real DN first.

EXAMPLES
  # User by sAM, auto-DC, table view
  bofexec enumacls -d bank.local --user fred --format table

  # Group by DN, pin DC, LDAPS
  bofexec enumacls -d bank.local --dc vagrant.bank.local --ldaps --group "CN=ITAdmins,OU=Groups,DC=bank,DC=local" --format json

  # Computer by hostname (adds $ automatically)
  bofexec enumacls -d bank.local --computer web01 --format kv

  # OU delegation sweep
  bofexec enumacls -d bank.local --ou "OU=Workstations,DC=bank,DC=local" --format csv
"""
        print(brightgreen + menu + reset)
        return

    @staticmethod
    def args_inject(p):
        p.add_argument("-d", "--domain", required=False, help="DNS domain (e.g., contoso.com)")
        p.add_argument("--dc", default="", help="Domain Controller hostname/FQDN (not IP)")
        p.add_argument("--ldaps", action="store_true", default=False, help="Use LDAPS (default port 636)")
        p.add_argument("--port", type=int, default=0, help="LDAP/LDAPS port (0 => default by scheme)")

        sel = p.add_mutually_exclusive_group(required=False)
        sel.add_argument("--user", default="", help="UPN|DN|sAM|SID")
        sel.add_argument("--group", default="", help="DN|sAM|SID")
        sel.add_argument("--computer", default="", help="DN|sAM|SID|hostname$")
        sel.add_argument("--ou", default="", help="DN (OU only)")

        p.add_argument("--format", choices=["kv","csv","table","json"], default="kv", help="Output format")

    @staticmethod
    def build_remote_args(ns) -> List[str]:
        domain = getattr(ns, "domain", "") or ""
        dc     = getattr(ns, "dc", "") or ""
        if dc and _is_ip(dc):
            raise ValueError("--dc must be a hostname/FQDN (no IPs)")

        ldaps  = 1 if getattr(ns, "ldaps", False) else 0
        portIn = int(getattr(ns, "port", 0) or 0)
        port   = portIn if portIn > 0 else (636 if ldaps else 389)

        if not any([ns.user, ns.group, ns.computer, ns.ou]):
            print(brightyellow + "You must use one of the following: --user, --group, --computer, --ou" + reset)
            return

        # selector
        selT = 0
        selV = ""
        if getattr(ns, "user", ""):
            selT, selV = 1, getattr(ns, "user")
        elif getattr(ns, "group", ""):
            selT, selV = 2, getattr(ns, "group")
        elif getattr(ns, "computer", ""):
            selT, selV = 3, getattr(ns, "computer")
        elif getattr(ns, "ou", ""):
            selT, selV = 4, getattr(ns, "ou")
        else:
            raise ValueError("exactly one of --user/--group/--computer/--ou is required")

        fmt_map = {"kv":0,"csv":1,"table":2,"json":3}
        fmtK = fmt_map.get(getattr(ns,"format","kv"), 0)

        
        args = [
            f"-Z:{domain}",
            f"-Z:{dc}",
            f"-i:{ldaps}",
            f"-i:{port}",
            f"-i:{selT}",
            f"-Z:{_space_escape(selV)}",
            f"-i:{fmtK}",
        ]

        print(args)
        return args
